// src/components/Banner.jsx
import React from 'react';
import '../index.css'

const Banner = () => {
  return (
    <section className="flex justify-center space-x-48">
      <div>
        <h2>SOFTWARE DEVELOPER</h2>
        <h1>VIKHAN MUHARRAM</h1>
        <h3>Turning ideas into real-world apps</h3>
      </div>

      <div>
        <img src="/assets/images/logoVM.jpg" alt="Logo VM" className="w-64 h-40" />
      </div>
    </section>
  );
};

export default Banner;
